import React from "react";

const ProfileStatusWithHooks = (props) =>  {
        return <>
            {<div>
                <input autoFocus={true} type="text"/>
            </div>}
            {false &&
                <div>
                    <span> {props.status || "No status"}</span>
                </div>
            }
        </>


}

export default ProfileStatusWithHooks
